import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      isLogged: false,
    };
  }

  onClick = () => {
    this.setState((prev) => {
      return {
        isLogged: !prev.isLogged,
      };
    });
  };
  render() {
    let button_text = this.state.isLogged ? 'Log out' : 'Log in';
    let disp = this.state.isLogged ? 'Logged in' : 'Logged out';

    return (
      <div>
        {disp}
        <br />
        <br />
        <button onClick={this.onClick}>button_text</button>
      </div>
    );
  }
}

export default App;
